<div class=""container"">
    <h1>Melbourne Local Course</h1>
    <div class=""row"">
        <div class=""col-xl-6 col-lg-6 col-md-12 col-sm-12"">
            <p>The Melbourne Part-time (Local) course runs over 8 months and is suitable for those living in Melbourne. Students are required to complete one full weekend of lectures per month at our Bayswater office, as well as one practical workshop per month at our kennel facility in Lysterfield.</p>
            <p>In addition to this, our Melbourne students are required to attend an obedience training club once a week. This is what we refer to as a ‘Home Centre’ and these NDTF approved businesses, conduct commercial dog training classes. These organisations mentor our students and provide opportunities for them to develop their skills, in a ‘working’ environment.</p>
