        <div class=""row"">
            <div class=""col-xl-6 col-lg-6 col-md-12 col-sm-12"">
                <h4>Practical Training Requirements</h4>
                <p>A dog trainer course would not be complete without the inclusion of hands-on practical training. There is only a certain amount you can learn through reading and watching DVDs. Precise Training provides students with an extensive opportunity to train many different dogs of all ages, breeds and temperaments, in a safe and supportive environment.</p>
                <p>Practical workshops are held on a monthly basis and are generally located at Wellington Park Kennels in Lysterfield. These are a compulsory requirement of the course and you will generally be given a selection of 2 dates to choose from. These dates are available well in advance, to assist you in planning your time.</p>
                <h4>Home Centres</h4>
                <p>Students are required to attend 100 ho");
            WriteLiteral(@"urs of practical training during their course. Practical workshops at the kennel facility are included in this total. The remaining hours are to be completed at your Home Centre. Precise Training allocates all students to a Home Centre at the commencement of their course. Centres are selected according to proximity of your home, your past experience, placement availability, etc.</p>
                <p>There may be instances where students are permitted to source their own Home Centre. This is often the case if a student is currently working / training / volunteering at an Obedience School / Club, however ALL Home Centres must be approved by Precise Training prior to attending. If you wish to request an alternative centre, please provide your Course Co-ordinator with the relevant details.</p>
            </div>
            <div class=""col-xl-6 col-lg-6 col-md-12 col-sm-12"">
                <p>To ensure that students receive a well-rounded education, Home Centres MUST be able to provide / facilitate the fol");
