                <br />
                <ul>
                    <li>Allow students to participate in class once the appropriate theory is covered (e.g. assist clients, instruct basic obedience and socialisation exercises, etc.)</li>
                    <li>Cater for a variety of dog breeds</li>
                    <li>Cater for varying ages, from puppies, through to adults</li>
                    <li>Cover training from puppy classes, through to advanced obedience</li>
                    <li>Address behaviour problems / issues</li>
                    <li>Have the resources and expertise to mentor students</li>
                    <li>Preferably offer socialisation classes</li>
                </ul>
                <br />
                <p>In order to reach your 100 hours, you will need to attend your Home Centre on a weekly basis. If you are sick, on holidays or cannot attend for any other reason, you are required to make up the hours on another day or at another location.</p>
